import React, { Component } from "react";


import Circle from "./images/CircleTexture2.png";



class Signup extends Component {
  render() {
    return (
      <div>
        <img src={Circle}/>
        <img src={Circle}/>
        <img src={Circle}/>
      </div>
    );
  }
}

export default Signup;
